import React from "react";
import { FcCheckmark } from "react-icons/fc";
import { GiCheckMark } from "react-icons/gi";

const Package = () => {
  return (
    <div className="border" style={{ height: 250, width: 250, margin: 20 }}>
      <div style={{ backgroundColor: "red", color: "white" }}>
        <h4>STANDARD</h4>
        <h5>1700/Sqft</h5>
      </div>

      <div
        className="row"
        style={{ textAlign: "left", padding: 5, fontSize: 14 }}
      >
        <FcCheckmark className="col-2" />
        <p className="col-10">
          Structure – branded and high quality cement, steel, concrete, bricks
        </p>
        <FcCheckmark className="col-2" />
        <p className="col-8">Bare shell – W/O Interiors</p>
      </div>
      <button>VIEW MORE</button>
    </div>
  );
};

export default Package;
